    name: 'Using props to pass data',
    exercises: 7
  }
  const part3 = {
    name: 'State of a component',
    exercises: 14
  }

  return (
    <div>
      <Header course = {course} />
      <p>This course is {part1.name} Exercisesnumber is {part1.exercises}</p>
      <p>This course is {part2.name} Exercisesnumber is {part2.exercises}</p>
      <p>This course is {part3.name} Exercisesnumber is {part3.exercises}</p>
    </div>
  )
}

export default App;
